import { enableRipple } from '@syncfusion/ej2-base';
enableRipple(false);
import { TimePicker } from '@syncfusion/ej2-calendars';

/**
 * Default sample
 */

let timeObj: TimePicker = new TimePicker({
    placeholder: 'Select a time'
});
timeObj.appendTo('#timepicker');
timeObj.show();
